import Skeleton, { SkeletonTheme } from "react-loading-skeleton";
import "../pages/movies.css";

const Smovies = () => {
  let imgurl;
  let title;
  setTimeout(function () {
    imgurl = "./images/space.jpg";
    title = "hello";
  }, 3000);

  return (
    <>
      <SkeletonTheme color="#202020" highlightColor="#2e302e">
        <div className="card">
          <div className="img">
            <img src="./images/space.jpg" alt="" />
          </div>
          <h2 className="title">Hello</h2>
        </div>
      </SkeletonTheme>
    </>
  );
};

export default Smovies;
